pragma solidity 0.5.16;

/**
 * Name    : Rage Factory Contract for managing contests smart contracts 
 * Company : Rage.Fan 
 * Author  : Saravana Malaichami (saravana at rage.fan)
 * Date    : 20-Feb-2021
 * Version : 0.1 
 */

import { RageContest } from './RageContest.sol';
import "./EIP712MetaTransaction.sol";

/**
* Chain id = 80001 is matic Mumbai test net rpc-mumbai. need to change for main net 
*/
contract RageFactory is  EIP712MetaTransaction {
    address[] public contests;
    address private  owner;

    address public libraryAddress;

    event ContestCreated(string name, address newContest);

    constructor( address _libraryAddress) 
    public 
    EIP712MetaTransaction("RageFactoryContract","1", 80001)
    {
       owner = msgSender();
       libraryAddress = _libraryAddress;
    }

    function createNewContest(string memory _id, string memory _name, string memory _version, uint256 _chainid, string memory _contestTitle, uint256 _contestFees, 
                              uint256 _winningAmount, bool _isActive, address _token )
                            public 
                            returns (address)
                             {

                 RageContest proxy = new RageContest(_id, _name, _version, _chainid, 
                                                          _contestTitle,
                                                          _contestFees,
                                                          _winningAmount,
                                                          _isActive,
                                                          _token); 

                contests.push(address(proxy));
                emit ContestCreated(_name, address(proxy));
              return address(proxy);
        }

      function getContests() external view returns (address[] memory) {
        return contests;
      }


        modifier onlyOwner {
        assert (msgSender() == owner) ;
        _;
    }

}
